import React from 'react';
import * as FaIcons from "react-icons/fa";
import {Link} from 'react-router-dom';

function Menu() {
    return (
        <>
        <div className="navbar">
            <Link to ="#" className='menu-bars'>
                <FaIcons.FaBars/>
            </Link>
        </div>
        </>
    )
}

export default Menu
